window.bookSummaryJSON = "Best-selling inspirational author Dr. Wayne Dyer can help you to achieve your highest goals by showing you how to attract your needs and desires into your life. Dr. Dyer's stunning work focuses on the ancient principle of manifesting. <p>Achieved through meditation, manifesting lets us streamline our thoughts, desires, and goals. Whether we realize it or not, built-in societal barriers often obstruct our inner potential, preventing us from achieving what we want. But Dr. Dyer's Nine Spiritual Principles of Manifesting clear away that which constricts us, illuminating a new path to reaching our truest goals.</p> <p>This inspiring manual is Dr. Dyer's most exciting and accessible work, a remarkable guidebook that shows us how to have what we truly desire.</p>"; 
